public void init()
{
    if (!this.args() || !this.args().caller())
    {
        throw error(strfmt("@SYS22862", element.name()));
    }

    if (this.args().dataset() != tablenum(PdsComdPricingMargin))
    {
        throw error(strfmt("@PDS421", element.name(),
            tablestr(PdsComdPricingMargin)));
    }

    if (!PdsParameters::find().DimensionSet)
    {
        throw error("@PDS1575");
    }

    pdsComdPricingMargin    = this.args().record();

    dimSelData = new PdsDimensionSelectionData();

    super();

    showDiffOnGrid = false;
    showPrevOnGrid = false;
    xSysLastValue::getLast(this);

    element.updateDesign(InventDimFormDesignUpdate::Init);

    dimSelData.parmDSFieldName(fieldStr(PdsComdPricingMarginLine, DefaultDimension));
    dimSelData.parmDSName(PdsComdPricingMarginLine_ds.query().dataSourceNo(1).name());
}

