public void multiUpdateArgreement(NoYes _update)
{
    PdsComdPricingMarginLine    marginLine;
    PdsComdPricingMarginLine    prevMarginLine =
        pdsComdPricingMarginLine.data();

    ttsbegin;

    marginLine = pdsComdPricingMarginLine_ds.getFirst(true);
    if (!marginLine)
    {
        marginLine = pdsComdPricingMarginLine;
    }

    while (marginLine)
    {
        pdsComdPricingMarginLine_ds.positionToRecord(marginLine);
        pdsComdPricingMarginLine.UpdateAgreement = _update;
        pdsComdPricingMarginLine.write();

        marginLine = pdsComdPricingMarginLine_ds.getNext();
    }

    ttscommit;

    pdsComdPricingMarginLine_ds.research();

    pdsComdPricingMarginLine_ds.positionToRecord(prevMarginLine);
}

