public void promptShowOptions()
{
    Dialog          dialog = new Dialog("@PDS483", element);
    DialogField     showPrevField;
    DialogField     showDiffField;

    showPrevField = dialog.addFieldValue(extendedtypestr(NoYesId), showPrevOnGrid,
        "@SYS16148", "@PDS509");
    showDiffField = dialog.addFieldValue(extendedtypestr(NoYesId), showDiffOnGrid,
        "@PDS423", "@PDS510");

    if (dialog.run())
    {
        showPrevOnGrid = showPrevField.value();
        showDiffOnGrid = showDiffField.value();
        this.updateDesign(InventDimFormDesignUpdate::FieldChange);
    }
}

