public void init()
{
    QueryBuildDataSource        ds;

    super();

    ds = this.query().dataSourceTable(tablenum(PdsComdPricingMarginLine));

    rangeCustAccount = ds.addRange(fieldnum(PdsComdPricingMarginLine,
        MarginAccountCode));
    rangeCustGroupId = ds.addRange(fieldnum(PdsComdPricingMarginLine,
        MarginAccountCode));
}

public void executeQuery()
{
    str         custQuery;

    #LocalMacro.CustAccountCondition '(\%1 == \%2) && (\%3 == "\%4")' #EndMacro

    if (ctrlItemGroupId.text())
    {
        rangeItemGroupId.value(queryValue(ctrlItemGroupId.text()));
    }
    else
    {
        rangeItemGroupId.value(SysQuery::valueUnlimited());
    }

    if (ctrlCustAccount.text())
    {
        custQuery = strfmt(#CustAccountCondition,
            fieldstr(PdsComdPricingMarginLine, MarginAccountCode),
            enum2int(PriceDiscPartyCodeType::Table),
            fieldstr(PdsComdPricingMarginLine, MarginAccountRelation),
            ctrlCustAccount.text()
                ? queryValue(ctrlCustAccount.text())
                : '');

        rangeCustAccount.value(custQuery);
    }
    else
    {
        rangeCustAccount.value(SysQuery::valueUnlimited());
    }

    if (ctrlCustGroupId.text())
    {
        custQuery = strfmt(#CustAccountCondition,
            fieldstr(PdsComdPricingMarginLine, MarginAccountCode),
            enum2int(PriceDiscPartyCodeType::GroupId),
            fieldstr(PdsComdPricingMarginLine, MarginAccountRelation),
            ctrlCustGroupId.text()
                ? queryValue(ctrlCustGroupId.text())
                : '');

        rangeCustGroupId.value(custQuery);
    }
    else
    {
        rangeCustGroupId.value(SysQuery::valueUnlimited());
    }

    if  (dimSelData != null)
    {
        dimSelData.updateQuery(this.query());
    }

    super();
}

